import '../App.css';
import { github, linkedIn, gmail, fb } from '../assets/socials';

export function Header() {
    return (
        <div className="header">
            <div className="socials">
                <a target="_blank"href="https://www.coursera.org/learn/advanced-react/ungradedLab/HhjsB/create-your-portfolio"><img src={github} alt="github" /></a>
                <a href="https://www.coursera.org/learn/advanced-react/ungradedLab/HhjsB/create-your-portfolio"><img src={linkedIn} alt="linkedin" /></a>
                <a href="https://www.coursera.org/learn/advanced-react/ungradedLab/HhjsB/create-your-portfolio"><img src={gmail} alt="gmail" /></a>
                <a href="https://www.coursera.org/learn/advanced-react/ungradedLab/HhjsB/create-your-portfolio"><img src={fb} alt="facebook" /></a>
            </div>
            <div className="nav">
                <button>Projects</button>
                <button>Contact Me</button>
            </div>
        </div>
    );
}
